const initialState=[
      'SLTS',
      'HELLOWORLD',
      'MAD WORLD'
    ]

export function playList(state = initialState, action) {
  if (action.type === 'ADD_TRACK'){
    return [
      ...state,
      action.playload
    ];
  }else if(action.type === 'DELETE_TRACK'){
    return state;
  }
  return state;
}
